import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Setting extends Component {
    constructor(props) {
        super(props);
        this.state = {
            test: ""
        }
    }
    componentDidMount() {
        console.log("setting");
    }
    render() {
        return (
            <div>
                <h1>Setting</h1>
                test
            </div>
        );
    }
}

export default Setting;
